import "./Inicio.css"; 
import Menu from "../../Menu";
import { useNavigate } from "react-router-dom";

const Inicio = () => {
  const navigate = useNavigate();
  function handleLogin() {
    // Lógica de autenticação do usuário aqui
    
    // Se o usuário estiver autenticado, navegue para a tela Inicio
    navigate("/");}

  return (
    <div>
      <Menu />
      <div className="MenuDireito">
        <div className="Titulos">        
          <h1 className="title1">Bom dia</h1>
          <h1 className="title2">Lídia Ribeiro</h1>
        </div>
          <button className="login-button" onClick={handleLogin}></button> 
      </div>
      
      {/* aqui você pode adicionar outros componentes e conteúdo */}
    </div>
  );
};

export default Inicio;
